import { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';

//component using function

const App = () => {

  const [counter, setCounter] = useState(0);

  useEffect(() => {
    setCounter(100);
  });
const name = null;
const isname = false;
  return (
    <div className="App">
      <button onClick={() => setCounter((prevCount) => prevCount-1)}>-</button>
      <h1>{ counter }</h1>
      <button onClick={() => setCounter((prevCount) => prevCount+1)}>+</button>
    </div>
  );
}

export default App;
